import Vue from 'vue'
import Router from 'vue-router'
import Home from './components/Home.vue'

Vue.use(Router)

export default new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home
    },
    {
      path: '/friendsharing',
      name: 'friendsharing',
      component: () => import(/* webpackChunkName: "about" */ './components/FriendSharing.vue')
    }
  ]
})
